import React from "react";
import Textbox from "./Textbox";

class App extends React.Component {
  state = {video: [], selectedVideo: null};

  render() {
    return (
      <div className="ui container">
        <Textbox onTermSubmit={this.onTermSubmit} />
      </div>
    )
  }
}

export default App;
